import { createBrowserRouter } from "react-router-dom";
import App from "../App";
import Home from "../Components/Home/Home";
import About from "../Components/About/About";

const routes = createBrowserRouter([
  {
    path: "/",
    element: <App />,
    children: [
      {
        path: "",
        element: <Home />,
      },
      {
        path: "about",
        element: <About />,
      },
      {
        path: "catalog",
        element: <Home />,
      },
      {
        path: "",
        element: <Home />,
      },
      {
        path: "",
        element: <Home />,
      },
    ],
  },
]);

export default routes;
